    // are met:
    // - There should not be more than three digits ('0'-'9') in the file's name.
    // - The file's name contains exactly one dot '.'
    // - The substring before the dot should not be empty, and it starts with a letter from 
    // the latin alphapet ('a'-'z' and 'A'-'Z').
    // - The substring after the dot should be one of these: ['txt', 'exe', 'dll']
    // Examples:
    // >>> fileNameCheck(("example.txt"))
    // ("Yes")
    // >>> fileNameCheck(("1example.dll"))
    // ("No")
    public static String fileNameCheck(String file_name) {
        String[] validExtensions = {"txt", "exe", "dll"};
        int dotIndex = file_name.indexOf('.');
        int digitCount = file_name.replaceAll("\\D", "").length();
        String namePart = file_name.substring(0, dotIndex);
        String extensionPart = file_name.substring(dotIndex + 1);
        if (dotIndex == -1 || digitCount > 3 || !Character.isLetter(namePart.charAt(0)) ||
            !Arrays.asList(validExtensions).contains(extensionPart)) {
            return "No";
        }
        return "Yes";

